options: "' ເມືອງຈັນທະບູລີ': ' ເມືອງຈັນທະບູລີ'\nເມືອງສີໂຄດຕະບອງ: ເມືອງສີໂຄດຕະບອງ\nເມືອງໄຊເສດຖາ: ເມືອງໄຊເສດຖາ\nເມືອງສີສັດຕະນາກ: ເມືອງສີສັດຕະນາກ\nເມືອງນາຊາຍທອງ: ເມືອງນາຊາຍທອງ\nເມືອງໄຊທານີ: ເມືອງໄຊທານີ\nເມືອງຫາດຊາຍຟອງ: ເມືອງຫາດຊາຍຟອງ\nເມືອງສັງທອງ: ເມືອງສັງທອງ\nເມືອງປາກງື່ມ: ເມືອງປາກງື່ມ"
